import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Dashboard = () => {
    const navigate = useNavigate();

    const handleLogout = () => {
        // JWT token'ı sil
        localStorage.removeItem('token');
        // Kullanıcıyı giriş sayfasına yönlendir
        navigate('/login');
    };

    return (
        <div>
            <h1>Finansal Analiz Uygulaması Dashboard</h1>
            <nav>
                <ul>
                    <li><Link to="/transactions">Gelir/Gider İşlemleri</Link></li>
                    <li><Link to="/recommendation">Yatırım Önerileri</Link></li>
                </ul>
            </nav>
            <button onClick={handleLogout}>Çıkış Yap</button>
        </div>
    );
};

export default Dashboard;
